import { createStore} from 'redux';

const myreducer = (state = [{
    todocaption: "action.todocaption",
    iscompleted:false
}],action) =>{
    switch(action.type){
        case "DEL_TODO":
            return [...state,{todocaption: action.todocaption,iscompleted:false}];
    }
}

const store = createStore(myreducer);

export default store;
